import React, { useState } from "react";
import logo from "../static/logo.png";
import "./sass/Navbar.css";

function Navbar() {
  const [currentPage, setCurrentPage] = useState("home");

  const setPage = (e) => {
    document.getElementById(currentPage).className = "nav-link";
    document.getElementById(e).className = "nav-link active";
    setCurrentPage(e);
  };

  return (
    <>
      <nav className="navbar navbar-light navbarBack ">
        <div className="container-fluid">
          <a className="navbar-brand textFont pr-4" href="/#">
            <img
              src={logo}
              alt="logo"
              width="40"
              height="35"
              className="d-inline-block align-top"
            />{" "}
            DirtyBits
          </a>

          <ul className="navbar-nav mr-auto d-flex flex-row align-content-start">
            <li className="nav-item mr-4">
              <a
                className="nav-link active"
                href="/#"
                id="home"
                onClick={() => setPage("home")}
              >
                Home
              </a>
            </li>
            <li className="nav-item mr-4">
              <a className="nav-link" href="/#" id="compete" onClick={() => setPage("compete")}>
                Compete
              </a>
            </li>
            <li className="nav-item mr-4">
              <a className="nav-link" href="/#" id="practice">
                Practice
              </a>
            </li>
            <li className="nav-item mr-4">
              <a className="nav-link" href="/#" id="blogs">
                Blogs
              </a>
            </li>
          </ul>
        </div>
      </nav>
    </>
  );
}

export default Navbar;
